import React from 'react'
import { Routes, Route, Router } from "react-router-dom";
import Hangman from './Hangman';
import { Link } from 'react-router-dom';



function App() {
  return (
    <div className="App">
      <Router>
        <div>
          <nav>
            <ul>
              <li>
                <Link to="/hangman">Hanmgan</Link>
              </li>
            </ul>
          </nav>
          <Switch>
            <Route exactly component={Hangman} pattern="/" />




          </Switch>
        </div>
      </Router>
    </div>
  );
}

export default App;
